        console.log(result)
    }

    const handleClick = () => {

    }
    return (
        <div>
            <button onClick={handleClick}>Create new Account</button>
            {data?.map((item, index) => {
                return (
                    <ul key={item.id}>
                        <li>{item.email}</li>
                        <li>{item.userName}</li>
                        <li>{item.fullName}</li>
                        <li>{item.department}</li>
                        <li>{item.position}</li>
                    </ul>
                );
            })}
        </div>
    )

}
